import * as Yup from 'yup';

export default function getInitialValues() {
  const values = {
    message: '',
    name: '',
    testimonialImage: '',
    location: '',
    designation: '',
    customerImage: '',
    enabled: true
  };

  return values;
}

export const tSchema = Yup.object()
  .shape({
    message: Yup.string().max(150),
    name: Yup.string().required()
  });
